import React from 'react';
import { createUser } from '../../actions/userActions';
import { useDispatch } from 'react-redux'
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import { useUserAuth } from '../../context/AuthProvider';

import './signUp.css';
import { Navbar3 } from '../../components';

const SignUp = () => {

    // Set data to BE
    const navigate = useNavigate();
    const [userData, setUserData] = useState({first: '', last: '', email: '', password: '', confirm: ''});
    const dispatch = useDispatch();
    // TODO: FLAG
    // const { register, logOut } = useUserAuth();
    const { register } = useUserAuth();

    // useEffect(() => {
    //   if (currentUser) {
    //     navigate("/message");
    //   }
    // }, [currentUser, navigate]);

    async function handleFormSubmit(e) {
        e.preventDefault();

        try {
          dispatch(createUser(userData));
          await register(userData.email, userData.password);
          navigate("/message");
        } catch (e) {
          console.log(e)
        }
    }

    // TODO: FLAG
    // function signOut() {
    //   logOut();
    // }

  return (
    <div>
      <Navbar3/>
      <div className='signup'>
        <h1>Sign Up</h1>
        <form onSubmit={handleFormSubmit}>
          <div className='signup__fields'>
            <div className='signup__name-container'>
              <div>
                <input
                  required
                  placeholder="First Name"
                  onChange={(e) => setUserData({...userData, first: e.target.value})}
                />
              </div>
              <div>
                <input
                  required
                  placeholder="Last Name"
                  onChange={(e) => setUserData({...userData, last: e.target.value})}
                />
              </div>
            </div>
            <div>
                <input
                  required
                  placeholder="Email"
                  onChange={(e) => setUserData({...userData, email: e.target.value})}
                />
              </div>
            <div>
              <input
                required
                placeholder="Password"
                onChange={(e) => setUserData({...userData, password: e.target.value})}
              />
            </div>
            <div>
              <input
                required
                placeholder="Confirm Password"
                onChange={(e) => setUserData({...userData, password: e.target.value})}
              />
            </div>
            {/* <div>
              <input
                id="confirmPassword"
                name="confirmPassword"
                type="password"
                autoComplete="current-password"
                required
                placeholder="Confirm password"
                onChange={(e) => setConfirmPassword(e.target.value)}
              />
            </div> */}
          </div>
          <div>
            {/* <button type="submit" disabled={loading}> */}
            <button type="submit">
              Register
            </button>
          </div>
        </form>
        {/* <button onClick={signOut}>
          Sign Out
        </button> */}
      </div>
    </div>
  )
}

export default SignUp
